import React, { Component } from 'react';
import NavBar from './navbar';
import ApplicationCard from './appcard';
import { Card, CardBody, CardTitle, Button, FormGroup, Input, Form} from 'reactstrap';
import axios from 'axios';

import { runInThisContext } from 'vm';
import ProfileCard from './profilecard';

class Profile extends Component {

	state = {
		// jobs: [],
		applications:[],

	}

	componentDidMount() {
		axios.get("https://jsonplaceholder.typicode.com/todos/")
		.then(res => {
			const jobs = res.data;
			const applications = [{"Name": "Nathan Bailey", "DegreeQualification": "x", "DegreeLevel": "x", "UniversityAttended": "x", "ALevelQualifications": [{"Subject": "Engineering ", "Grade": "B"}, {"Subject": "Portuguese ", "Grade": "B"}, {"Subject": "Japanese ", "Grade": "B"}, {"Subject": "Food Technology ", "Grade": "B"}], "LanguagesKnown": [{"Language": "C#", "Expertise": 4}, {"Language": "C++", "Expertise": 0}, {"Language": "Java", "Expertise": 2}], "PreviousEmployment": [{"Company": "Shoreline", "Position": "Module Lead", "Length of Employment": "1 year 9 months"}, {"Company": "Gekko and Co.", "Position": "software developer", "Length of Employment": "1 year 9 months"}], "Skills": [{"Skill": "Public Speaking", "Expertise": 3}, {"Skill": "Motivated", "Expertise": 6}, {"Skill": "Search engine optimization", "Expertise": 7}, {"Skill": "Text Editing", "Expertise": 1}, {"Skill": "Quality Assurance", "Expertise": 1}, {"Skill": "Skype", "Expertise": 7}, {"Skill": "Video Editing", "Expertise": 2}], "Hobbies": [], "Response": "x", "score_degree": 3.0, "score_alevels": 4.0, "score_lang": 5.0, "score_employment": 6.0, "score_skills": 7.0, "ID": 1}]

			// console.log(jobs);
			// console.log(locations);

			this.setState({ applications });
			// this.setState({ jobs });
			// console.log(locations);
		})
	}

	render() {
		let filter = {
			margin: '15px',
			marginLeft: '40px',
			fontFamily: 'Quicksand',
			width: '25%',
			height: '100vh',
			float: 'left',
		}
		let jobs = {
			margin: '15px',
			fontFamily: 'Quicksand',
			width: '68%',
			height: '100vh',
			float: 'right',
		}
		let welcome = {
			marginLeft: '10%',
			marginRight: '10%',
			height: '200px',
			textAlign: 'center',
			backgroundColor: '#C0C0C0'
		}
		let content = {
			margin: '30px', 
			marginLeft: '10%',
			marginRight: '10%'
		}
		const application_length = this.state.applications.length;
		return (
			<div>
				<div style={{fontFamily: 'Quicksand'}}>
					<NavBar />
					<div style={welcome}>
						<h3 style={{lineHeight: '200px'}}>Dashboard</h3>			
					</div>
					<div style={content}>
						<div>
							<h4>Submitted applications</h4>
							<p>{application_length} result(s)</p>
							{this.state.applications.map(t =>

						<ProfileCard>

						<h6>Degree</h6>
							<ul>
								<li>Degree: {t.DegreeQualification}</li>
								<li>Degree Level: {t.DegreeLevel}</li>
								<li>University Attended: {t.UniversityAttended}</li>
							</ul>
							<h6>A-Levels</h6>
							<ul>
							{t.ALevelQualifications.map(x=>
								<li>Subject: {x.Subject}. Grade: {x.Grade}</li>
							)}
							</ul>
							<h6>Langauges</h6>
							<ul>
							{t.LanguagesKnown.map(x=>
								<li>Language: {x.Language}. Expertise: {x.Expertise}</li>
							)}
							</ul>
							<h6>Previous Employment</h6>
							<ul>
							{t.PreviousEmployment.map(x=>
								<li>Company: {x.Company}. Position: {x.Position}</li>
							)}
							</ul>
							<h6>Skills</h6>
							<ul>
							{t.Skills.map(x=>
								<li>Skill: {x.Skill}. Expertise: {x.Expertise}</li>
							)}
							</ul>
							<div style={{textAlign: 'center'}}>
						</div>			
						</ProfileCard>

						)}
						</div>			
					</div>

				</div>
			</div>
		);
	}
}

export default Profile;
